import React from 'react'


const Cart = ({ products }) => {

    return (
        <div className="cart-page">
            {products.map(product => (
                <div>
                    <h1>{product.title}</h1>
                    <h2>{product.price}</h2>
                </div>
            ))}
        </div>
    )
}

export default Cart
